import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for the cart element using text selector (div with text 'Cart')
    await page.waitForSelector('div.cart', { timeout: 5000 });

    // Click on the cart area to open the cart modal
    // Use text-based selector to avoid class-only selection
    const cartDiv = await page.$('//div[contains(normalize-space(.), "Cart")]');
    if (!cartDiv) throw new Error('Cart element not found');
    await cartDiv.click();

    // Wait for the cart modal to appear (look for h2 "Shopping Cart" or class "cart-content")
    // Try multiple selectors for robustness
    let cartModalAppeared = false;
    const modalSelectors = [
      'div#cartModal', // ID-based
      'div.modal[style*="display: block"]', // Visible modal
      '//div[contains(@class,"cart-content")]',
      '//h2[contains(text(), "Cart")]',
      'div.cart-content'
    ];
    for (const selector of modalSelectors) {
      try {
        await page.waitForSelector(selector, { timeout: 2000 });
        cartModalAppeared = true;
        break;
      } catch (e) {
        // Try next selector
      }
    }

    // Take screenshot after opening cart modal
    const step2 = path.join(screenshotsDir, 'step_2_cart_modal_opened.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Extract cart modal visible state and any cart items text
    let cartModalVisible = false;
    let cartItemsText = '';
    if (cartModalAppeared) {
      // Check if modal is visible
      const modalHandle = await page.$('div#cartModal');
      if (modalHandle) {
        const display = await modalHandle.evaluate(el => getComputedStyle(el).display);
        cartModalVisible = display !== 'none';
        cartItemsText = await modalHandle.innerText();
      } else {
        // Try with cart-content
        const cartContentHandle = await page.$('div.cart-content');
        if (cartContentHandle) {
          cartModalVisible = true;
          cartItemsText = await cartContentHandle.innerText();
        }
      }
    }

    return {
      success: cartModalAppeared && cartModalVisible,
      action: "Opened the Shopping Cart modal by clicking the cart area",
      extractedData: {
        cartModalVisible,
        cartItemsText: cartItemsText ? cartItemsText.trim().slice(0, 200) : ''
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
